<dom-module id="ytd-account-settings" assetpath="/ytd-account-settings/" css-build="shady">
  
  <template class="style-scope ytd-account-settings">
    
    <template is="dom-if" if="[[computeIsMainPage_(dropdownPage_)]]" class="style-scope ytd-account-settings">
      <paper-item role="button" on-tap="onLanguageTap_" class="style-scope ytd-account-settings">
        <div id="language" class="style-scope ytd-account-settings">
          <span class="label style-scope ytd-account-settings">[[menuStrings_.LANGUAGE_LABEL]]</span>
          <span class="style-scope ytd-account-settings">[[clientSettings_.language]]</span>
        </div>
        <yt-icon icon="yt-icons:chevron_right" class="style-scope ytd-account-settings"></yt-icon>
      </paper-item>
      <paper-item role="button" on-tap="onCountryTap_" class="style-scope ytd-account-settings">
        <div id="country" class="style-scope ytd-account-settings">
          <span class="label style-scope ytd-account-settings">[[menuStrings_.COUNTRY_LABEL]]</span>
          <span class="style-scope ytd-account-settings">[[clientSettings_.country]]</span>
        </div>
        <yt-icon icon="yt-icons:chevron_right" class="style-scope ytd-account-settings"></yt-icon>
      </paper-item>
      <paper-item role="button" on-tap="onRestrictedModeTap_" class="style-scope ytd-account-settings">
        <div id="restricted" class="label style-scope ytd-account-settings">
          <span class="style-scope ytd-account-settings">[[menuStrings_.RESTRICTED_MODE_LABEL]]</span>
          <span class="style-scope ytd-account-settings">[[computeRestrictedModeText_(clientSettings_.restrictedMode)]]</span>
        </div>
        <yt-icon icon="yt-icons:chevron_right" class="style-scope ytd-account-settings"></yt-icon>
      </paper-item>
      <paper-item role="button" on-tap="onPreferenceToSuppressPolymer_" class="style-scope ytd-account-settings">
        [[menuStrings_.CLASSIC_YOUTUBE_LABEL]]
      </paper-item>
    </template>
    <template is="dom-if" if="[[computeIsLanguagesPage_(dropdownPage_)]]" class="style-scope ytd-account-settings">
      <div class="list list-long style-scope ytd-account-settings">
        <div class="header style-scope ytd-account-settings" hidden="[[data.inlined]]">
          <button is="paper-icon-button-light" aria-label$="[[menuStrings_.BACK_ALT_LABEL]]" noink="" on-tap="onBackTap_" class="style-scope ytd-account-settings">
            <yt-icon icon="yt-icons:arrow-back" class="style-scope ytd-account-settings"></yt-icon>
          </button>
          <h2 class="style-scope ytd-account-settings">[[menuStrings_.CHOOSE_LANGUAGE_LABEL]]</h2>
        </div>
        <div class="container style-scope ytd-account-settings">
          <yt-icon class="spinner style-scope ytd-account-settings" hidden="[[!languagesLoading_]]" icon="spinners:ring">
          </yt-icon>
          <template id="language-repeat" is="dom-repeat" items="[[languages_]]" class="style-scope ytd-account-settings">
            <paper-item class$="[[getListItemClass_(item.2)]]" role="button" on-tap="onLanguageSelect_" class="style-scope ytd-account-settings">
              <template is="dom-if" if="[[item.2]]" class="style-scope ytd-account-settings">
                <yt-icon class="selected style-scope ytd-account-settings" icon="yt-icons:check"></yt-icon>
              </template>
              [[item.1]]
            </paper-item>
          </template>
        </div>
      </div>
    </template>
    <template is="dom-if" if="[[computeIsCountriesPage_(dropdownPage_)]]" class="style-scope ytd-account-settings">
      <div class="list list-long style-scope ytd-account-settings">
        <div class="header style-scope ytd-account-settings" hidden="[[data.inlined]]">
          <button is="paper-icon-button-light" aria-label$="[[menuStrings_.BACK_ALT_LABEL]]" noink="" on-tap="onBackTap_" class="style-scope ytd-account-settings">
            <yt-icon icon="yt-icons:arrow-back" class="style-scope ytd-account-settings"></yt-icon>
          </button>
          <h2 class="style-scope ytd-account-settings">[[menuStrings_.CHOOSE_COUNTRY_LABEL]]</h2>
        </div>
        <div class="container style-scope ytd-account-settings">
          <yt-icon class="spinner style-scope ytd-account-settings" hidden="[[!countriesLoading_]]" icon="spinners:ring">
          </yt-icon>
          <template id="country-repeat" is="dom-repeat" items="[[countries_]]" class="style-scope ytd-account-settings">
            <paper-item class$="[[getListItemClass_(item.3)]]" role="button" on-tap="onCountrySelect_" class="style-scope ytd-account-settings">
              <template is="dom-if" if="[[item.3]]" class="style-scope ytd-account-settings">
                <yt-icon class="selected style-scope ytd-account-settings" icon="yt-icons:check"></yt-icon>
              </template>
              [[item.2]]
            </paper-item>
          </template>
        </div>
      </div>
    </template>
